import React from "react";
import styles from "./Table.module.css"; // Import CSS module for styling

const Table = ({ data }) => {
  return (
    <div className={styles.tableContainer}>
      <table className={styles.table}>
        <thead>
          <tr>
            <th>Hostname</th>
            <th>IP</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row, index) => (
            <tr key={index}>
              <td>{row.hostname}</td>
              <td>{row.ip}</td>
              <td
                className={
                  row.status === "Online"
                    ? styles.statusOnline
                    : styles.statusOffline
                }
              >
                {row.status}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};
